import slide1 from "./";
export const Home = () => {
  return (
    <body>
    <div className="home">    
      <Navbar/>    
      {/* <img className="img-Background" src="imgdentist.jpg" alt=""></img> */}
      {/* SLIDER */}
        <div id="main-slider" class="flexslider">
            <ul class="slides">
              <li>
                <img src="" alt=""></img>
                <div class="flex-caption">
                    <h3>Smile Dent</h3> 
					{/* <p>Tu salud es importante</p>  */}
					 
                </div>
              </li>
