                <img src="img/slides/2.jpg" alt="" ></img>
                <div class="flex-caption">
                    <h3>Profesionales Calificados</h3> 
					<p>Conf√≠a en nosotros</p> 
					 
                </div>
              </li>
            </ul>
        </div>

    </div>
    </body>
  );
};
